import React from "react";
import h from "./css/Header.module.css";
const Header = (props) => {
  return (
    <div className={h.header}>
      <button type="button" onClick={props.onHandleClick}>
        {props.darkMode ? "Dark Mode" : "Light Mode"}
      </button>
    </div>
  );
};

export default Header;
